import React from "react";

interface Menu {
  menu1: string
  menu2: string
  menu3: string
}

class HeaderComponent extends React.Component<Menu> {
  render(): React.ReactNode {
    const { menu1, menu2, menu3} = this.props
    return (
      <header className="text-cente fixed top-0 w-full">
        <div>
          <span>로고</span>
          <span>MY</span>
        </div>
        <div>
          <ul className="justify-between max-w-3xl mr-auto ml-auto flex whitespace-nowrap">
            <li>{menu1}</li>
            <li>{menu2}</li>
            <li>{menu3}</li>
          </ul>
        </div>
      </header>
    );
  }
}

export default HeaderComponent;
